tables.table_schema:
CREATE TABLE ModelMetrics (
  model_id UUID PRIMARY KEY,
  accuracy FLOAT,
  precision FLOAT,
  recall FLOAT
);

CREATE TABLE FeatureImportance (
  feature_id UUID PRIMARY KEY,
  importance FLOAT
);

CREATE TABLE ModelPerformance (
  model_id UUID PRIMARY KEY,
  training_time FLOAT,
  testing_time FLOAT
);

CREATE TABLE ComparisonResults (
  result_id UUID PRIMARY KEY,
  model_id UUID,
  comparison_type VARCHAR,
  comparison_result FLOAT
);
